description:
Bachchan is a 2013 Kannada action film directed by Shashank featuring Sudeep, Bhavana, Parul Yadav and Tulip Joshi in the lead roles. The film features background score and soundtrack composed by V. Harikrishna and cinematography handled by Shekar Chandru.

